script: |
  super -f tsv -I q262.sql | sort > q262.out

vector: true

inputs:
  - name: q262.sql
    data: |
      SELECT DISTINCT + 30 + COUNT ( * ) AS col2 FROM tab2 WHERE NOT ( 19 + + 55 * - CAST ( + 13 AS INTEGER ) ) < ( + col2 * + 2 );
  - name: tab2

outputs:
  - name: q262.out
    data: |
      30
